import './App.css';
import {BrowserRouter, Route, Link} from "react-router-dom";
import Cont from './Cont';

function App() {
  return (
    <div className="App">

      <BrowserRouter>
      <header className="App-header">
        <ul>
          <li><Link to="/">Home</Link></li>
          <li><button>Movies</button></li>
          <li><button>TV Series</button></li>
          <li><button>Channels</button></li>
        </ul>
      </header>
        <Route path='/' element={<Cont/>}>

        </Route>
      </BrowserRouter>
    </div>

  );
}

export default App;
